use async_trait::async_trait;
use num_bigint::BigUint;

use novax::{Address, CodeMetadata};
use novax::code::DeployData;
use novax::errors::NovaXError;
use novax::executor::{BlockchainInteractor, ExecutorError, TransactionOnNetwork, TransactionOnNetworkTransaction, TransactionOnNetworkTransactionLogs, TransactionOnNetworkTransactionLogsEvents, TransactionOnNetworkTransactionSmartContractResult, Wallet};
use novax::executor::BaseTransactionNetworkExecutor;
use novax::executor::call_result::CallResult;
use novax::tester::tester::TesterContract;
use novax::testerwithreturningdeploy::testerwithreturningdeploy::TesterWithReturningDeployContract;

mod utils;

const CALLER_PRIVATE_KEY: &str = "69417ce717e43d0d3a598f68b5e562d7d2a532a5a3ac1e8b3342515e0b2d950f"; // to anyone reading : this has been generated only for the tests below
const CALLER: &str = "erd12wf7tlsk2z895vwmndheaknkp3uaqa7xuq847numkwlmcvy60wxql2ndlk";
const NEW_CONTRACT: &str = "erd1qqqqqqqqqqqqqpgq74myhunu4sfdpmskm6s6ul8k4cetjvhhlfpsaa20la";

struct MockInteractor {
    wallet: Wallet
}

#[async_trait]
impl BlockchainInteractor for MockInteractor {
    async fn new(_gateway_url: String, wallet: Wallet) -> Result<Self, ExecutorError> {
        Ok(
            MockInteractor {
                wallet,
            }
        )
    }

    async fn sc_call(&mut self, _to: String, value: BigUint, data: String, _gas_limit: u64) -> Result<TransactionOnNetwork, ExecutorError>     {
        let mut return_data: Option<String> = None;

        let deploy_with_biguint_arg_metadata_nothing_data = "@0500@0000@05";
        let deploy_with_biguint_arg_biguint_return_metadata_nothing_data = "@0500@0000@0a";
        let deploy_with_biguint_arg_metadata_upgradeable_readable_data = "@0500@0500@07";
        let deploy_with_biguint_arg_metadata_nothing_data_egld_value = "@0500@0000@08";

        if data == deploy_with_biguint_arg_metadata_nothing_data {
            return_data = Some("@6f6b".to_string());
        } else if data == deploy_with_biguint_arg_biguint_return_metadata_nothing_data {
            return_data = Some("@6f6b@0a".to_string());
        } else if data == deploy_with_biguint_arg_metadata_upgradeable_readable_data {
            return_data = Some("@6f6b".to_string());
        } else if data == deploy_with_biguint_arg_metadata_nothing_data_egld_value && value == BigUint::from(100u8) {
            return_data = Some("@6f6b@08".to_string());
        }

        let Some(return_data) = return_data else {
            panic!("Unknown data for : \"{data}\"");
        };

        let response = TransactionOnNetwork {
            transaction: TransactionOnNetworkTransaction {
                gas_used: 0,
                smart_contract_results: Some(vec![
                    TransactionOnNetworkTransactionSmartContractResult {
                        hash: "".to_string(),
                        nonce: 1,
                        data: return_data,
                    }
                ]),
                logs: Some(
                    TransactionOnNetworkTransactionLogs {
                        address: CALLER.to_string(),
                        events: vec![
                            TransactionOnNetworkTransactionLogsEvents {
                                address: NEW_CONTRACT.to_string(),
                                identifier: "SCDeploy".to_string(),
                                topics: vec![],
                                data: Some(data),
                            }
                        ],
                    }
                ),
                status: "success".to_string(),
            },
        };

        return Ok(response)
    }

    fn get_sender_address(&self) -> Address {
        self.wallet.get_address()
    }
}


async fn get_executor() -> BaseTransactionNetworkExecutor<MockInteractor> {
    let wallet = Wallet::from_private_key(CALLER_PRIVATE_KEY).unwrap();

    BaseTransactionNetworkExecutor::new(
        "".to_string(),
        wallet
    )
        .await
        .unwrap()
}

#[tokio::test]
async fn test_deploy_with_biguint_arg() -> Result<(), NovaXError> {
    let mut executor = get_executor().await;

    let deploy_data = DeployData {
        code: "../../.novax/tester-contract.wasm",
        metadata: CodeMetadata::empty(),
    };

    let deploy_result: (Address, CallResult<()>) = TesterContract::deploy(
        deploy_data,
        &mut executor,
        BigUint::from(0u8),
        600000000u64,
        &BigUint::from(5u8)
        )
        .await
        .unwrap();

    assert_eq!(deploy_result.0, Address::from(NEW_CONTRACT));

    Ok(())
}

#[tokio::test]
async fn test_deploy_with_return_value() -> Result<(), NovaXError> {
    let mut executor = get_executor().await;

    let deploy_data = DeployData {
        code: "../../.novax/tester-contract.wasm",
        metadata: CodeMetadata::empty(),
    };

    let deploy_result: (Address, CallResult<BigUint>) = TesterWithReturningDeployContract::deploy(
        deploy_data,
        &mut executor,
        BigUint::from(0u8),
        600000000u64,
        &BigUint::from(10u8)
    )
        .await
        .unwrap();

    assert_eq!(deploy_result.0, Address::from(NEW_CONTRACT));
    assert_eq!(deploy_result.1.result.unwrap(), BigUint::from(10u8));

    Ok(())
}

